import $ from 'jquery';

$(function () {
    var jq_help_washmore_pay1yuan = "data:image/png;base64,";

    var jq_help_washmore_paymore = "data:image/png;base64,";
    init();
    function init() {
        var append = '<div id="notice" style="display: none;background-color: rgba(0, 0, 0, 0.2);\n' +
            '            height: 100%;\n' +
            '            width: 100%;\n' +
            '            position: fixed;\n' +
            '            z-index: 99;\n' +
            '            margin-top: 0px;\n' +
            '            top: 0px;">\n' +
            '    <div id="notice-center" style=" width: 100%;\n' +
            '            height: 100%;\n' +
            '            position: relative;">\n' +
            '        <div id="notice-center-absolute" style=" position: absolute;\n' +
            '            left: 50%;\n' +
            '            top: 50%;\n' +
            '            transform: translate(-50%, -50%);\n' +
            '            padding: 8px;\n' +
            '            max-width: 75%;\n' +
            '            /*height: 20px;*/\n' +
            '            background: white;\n' +
            '            text-align: center;">\n' +
            '            <div class="notice-content">\n' +
            '                <img class="pay_img jq_help_washmore_wx_pay" src="' + jq_help_washmore_pay1yuan + '"><br/>\n' +
            '                <button class="pay_toggle jq_help_washmore_wx_toggle">其他金额</button>\n' +
            '                <br/>\n' +
            '                <br/>\n' +
            '                <strong>快来为洗澡狂魔续一秒!</strong>\n' +
            '            </div>\n' +
            '        </div>\n' +
            '    </div>\n' +
            '</div>';
        $('body').append(append);
        if ($('.support_washmore').length == 0) {
            $('body').append('<button class="support_washmore">赞助狂魔</button>');
        }
    }
    $('.support_washmore').on('click',function () {
        $("#notice").show();
    })

    var clearId = null;
    $("#notice").on('click',function () {
        clearTimeout(clearId);
        clearId = setTimeout(function () {
            $("#notice").fadeOut(2000);
        }, 500);
    });
    $(".jq_help_washmore_wx_toggle").on('click',function (event) {
        if ($(".jq_help_washmore_wx_toggle").text() == "其他金额") {
            $(".jq_help_washmore_wx_pay").attr("src", jq_help_washmore_paymore);
            $(".jq_help_washmore_wx_toggle").text("只续一元");
        } else {
            $(".jq_help_washmore_wx_pay").attr("src", jq_help_washmore_pay1yuan);
            $(".jq_help_washmore_wx_toggle").text("其他金额");
        }
        clearTimeout(clearId);
        event.stopPropagation();
    });
    $(".jq_help_washmore_wx_pay").on('click',function (event) {
        clearTimeout(clearId);
        event.stopPropagation();
    });
})